    this.fluidvars.baseCurrency = this.fluidvars.CountryCode === 'USA' ? 'USD' : 'EUR';
    this.fxratesURL = this.fluidvars.baseCurrency === 'USD' ? '/fileadmin/templates/json/fxrates-ws_usd.js?' : '/fileadmin/templates/json/fxrates-ws.js?';
